def token_ex(clean_text):
    nlp = en_core_web_sm.load()
    doc = nlp(clean_text)
    output = []
    for X in doc.ents:
        if X.label_ == 'GPE':
            output.append((X.text, X.label_))
    return output


def twitter_sp(name):
    def twitter_profile(user):
        consumer_key = credentials.consumer_key
        consumer_secret = credentials.consumer_secret
        access_token = credentials.access_token
        access_secret = credentials.access_secret
        api = twitter.Api(consumer_key=consumer_key, consumer_secret=consumer_secret, access_token_key=access_token, \
                          access_token_secret=access_secret)
        print(user)
        try:
            user_id = api.UsersLookup(screen_name=user)
            stat = user_id[0].location
        except:
            stat = ''
        # print(stat)
        return stat

    tmp = open(name, 'r')
    text = tmp.read()
    text = text.split('\n')[:-1]
    output = defaultdict(list)
    p1 = re.compile(r'[<](.*?)[>]')
    for tweet in text:
        username = re.findall(p1, tweet)[0]
        geo_stat = twitter_profile(username)
        time = tweet[20:44]
        msg = tweet[54::]
        if geo_stat:
            msg += geo_stat
        res = token_ex(msg)
        if res:
            output[time].append(res)
    print(output)
    print(len(output))


twitter_sp('Twitter_outage_Xfinity.txt')


def reddit_sp(name):
    output = defaultdict(list)
    with open(name, newline='') as csvfile:
        reader = csv.reader(csvfile, delimiter=',')
        for row in reader:
            time = row[0]
            subre = row[1]
            txt = row[2] + ' ' + row[3]
            res_pre = token_ex(txt)
            if res_pre:
                output[time].append(res_pre)
    print(output)


