def distribution_viewer(name, type):
    time_flow = defaultdict(int)
    if type == 'r':
        with open(name, newline='') as csvfile:
            reader = csv.reader(csvfile, delimiter=',')
            for row in reader:
                # time = row[0][:11]
                time = row[0][:7]
                time_flow[time] += 1
    else:
        tmp = open(name, 'r')
        text = tmp.read()
        if type == 't':
            text = text.split('\n')[:-1]
            for tweet in text:
                # time = tweet[20:32]
                time = tweet[20:27]
                time_flow[time] += 1
        elif type == 'f':
            pages = text.split('Best Match')
            for page in pages:
                posts = page.split(' ' * 33)
                for post in posts:
                    date = re.search(r"[0-1][0-9]-[0-2][0-9]-20[0-9][0-9]", post)
                    if date:
                        tmp2 = date.group()[:2]
                        time_flow[tmp2] += 1
    return time_flow

